import React from 'react'
import { Container } from '@mui/system'
import { Box } from '@mui/material'
import images from "../media/hero_illustration.jpg"

const Cards = () => {
  return (
    <Container style={{display:"flex", justifyContent:"space-evenly"}}>

<Box sx={{border:"solid 40px violet", border}}>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>


<Box>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>

</Container>
  );
}

export default Cards
